import React, { useState } from "react";
import Button from "@mui/material/Button";
import Switch from "@mui/material/Switch";
import { createTheme, ThemeProvider } from "@mui/material/styles";
import CssBaseline from "@mui/material/CssBaseline";
import { BrowserRouter as Router, Link, Route, Routes } from "react-router-dom";
import "./App.css";
import HOME from "./COMPONENTS/HOME";
import EXCHANGE from "./COMPONENTS/EXCHANGE ";

function App() {
  const [darkMode, setDarkMode] = useState(false);

  const theme = createTheme({
    palette: {
      mode: darkMode ? "dark" : "light",
      primary: {
        main: darkMode ? "#90caf9" : "#1976d2",
      },
    },
  });

  const handleThemeChange = () => {
    setDarkMode(!darkMode);
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <div className="App">
        <Router>
          <nav
            style={{
              backgroundColor: darkMode ? "#333" : "#1976d2",
              display: "flex",
              flexWrap: "wrap", // make content wrap on small screens
              justifyContent: "space-between",
              alignItems: "center",
              padding: "10px",
            }}
          >
            <h2 className="title" style={{ color: "#fff", margin: 0 }}>
              Loan Calculator
            </h2>
            <div
              className="links"
              style={{
                display: "flex",
                flexDirection: "row",
                flexWrap: "wrap", // allow buttons to wrap on smaller screens
                alignItems: "center",
              }}
            >
              <Link to="/" style={{ textDecoration: "none", padding: "5px" }}>
                <Button variant="text" sx={{ color: "#ffffff" }}>home</Button>
              </Link>
              <Link to="/exchange-rates" style={{ textDecoration: "none", padding: "5px" }}>
                <Button variant="text" sx={{ color: "#ffffff" }}>exchange rates (live)</Button>
              </Link>
              <Link to="/about" style={{ textDecoration: "none", padding: "5px" }}>
                <Button variant="text" sx={{ color: "#ffffff" }}>about</Button>
              </Link>
              <Switch checked={darkMode} onChange={handleThemeChange} />
            </div>
          </nav>

          <Routes>
            <Route path="/" element={<HOME />} />
            <Route path="/about" element={<ABOUT />} />
            <Route path="/exchange-rates" element={<EXCHANGE />} />
          </Routes>
        </Router>
      </div>
    </ThemeProvider>
  );
}

export default App;
